Building robust CLI applications: use clap::{Parser, Subcommand, ArgGroup};
use std::path::PathBuf; // Main CLI structure
#[derive(Parser, Debug)]
#[command(name = "file-manager")]
#[command(about = "A comprehensive file management tool")]
#[command(version = "1.0.0")]
struct Cli { /// Enable verbose output #[arg(short, long)] verbose: bool, /// Configuration file path #[arg(short, long, value_name = "FILE")] config: Option<PathBuf>, /// Output format #[arg(short, long, value_enum, default_value_t = OutputFormat::Json)] format: OutputFormat, #[command(subcommand)] command: Commands,
} #[derive(Subcommand, Debug)]
enum Commands { /// Copy files or directories Copy { /// Source path source: PathBuf, /// Destination path destination: PathBuf, /// Copy recursively for directories #[arg(short, long)] recursive: bool, /// Overwrite existing files #[arg(short, long)] force: bool, }, /// Find files matching criteria Find { /// Directory to search in #[arg(default_value = ".")] path: PathBuf, /// File name pattern #[arg(short, long)] name: Option<String>, /// File extension filter #[arg(short, long)] extension: Option<String>, /// Minimum file size in bytes #[arg(long)] min_size: Option<u64>, /// Maximum file size in bytes #[arg(long)] max_size: Option<u64>, /// Maximum search depth #[arg(short, long, default_value_t = 10)] depth: usize, }, /// Convert between file formats Convert { /// Input file input: PathBuf, /// Output file (optional, derives from input if not provided) output: Option<PathBuf>, /// Source format (auto-detected if not specified) #[arg(long)] from: Option<Format>, /// Target format #[arg(long)] to: Format, },
} #[derive(clap::ValueEnum, Clone, Debug)]
enum OutputFormat { Json, Yaml, Table,
} #[derive(clap::ValueEnum, Clone, Debug)]
enum Format { Json, Toml, Yaml, Csv,
} // CLI implementation
fn run_cli() -> Result<(), Box<dyn std::error::Error>> { let cli = Cli::parse(); if cli.verbose { println!("Verbose mode enabled"); } if let Some(config_path) = &cli.config { println!("Using config file: {}", config_path.display()); // Load configuration } match &cli.command { Commands::Copy { source, destination, recursive, force } => { copy_command(source, destination, *recursive, *force)?; } Commands::Find { path, name, extension, min_size, max_size, depth } => { find_command(path, name.as_deref(), extension.as_deref(), *min_size, *max_size, *depth, &cli.format)?; } Commands::Convert { input, output, from, to } => { convert_command(input, output.as_ref(), from.as_ref(), to)?; } } Ok(())
} // Command implementations
fn copy_command( source: &PathBuf, dest: &PathBuf, recursive: bool, force: bool,
) -> Result<(), Box<dyn std::error::Error>> { println!("Copying {} to {} (recursive: {}, force: {})", source.display(), dest.display(), recursive, force); if !source.exists() { return Err(format!("Source path does not exist: {}", source.display()).into()); } if dest.exists() && !force { return Err("Destination exists and --force not specified".into()); } if source.is_file() { fs::copy(source, dest)?; println!("File copied successfully"); } else if source.is_dir() && recursive { copy_dir_recursive(source, dest)?; println!("Directory copied successfully"); } else { return Err("Use --recursive flag to copy directories".into()); } Ok(())
} fn copy_dir_recursive(src: &Path, dst: &Path) -> io::Result<()> { fs::create_dir_all(dst)?; for entry in fs::read_dir(src)? { let entry = entry?; let src_path = entry.path(); let dst_path = dst.join(entry.file_name()); if src_path.is_file() { fs::copy(&src_path, &dst_path)?; } else if src_path.is_dir() { copy_dir_recursive(&src_path, &dst_path)?; } } Ok(())
} fn find_command( path: &PathBuf, name_pattern: Option<&str>, extension: Option<&str>, min_size: Option<u64>, max_size: Option<u64>, max_depth: usize, output_format: &OutputFormat,
) -> Result<(), Box<dyn std::error::Error>> { let mut results = Vec::new(); find_files_recursive(path, name_pattern, extension, min_size, max_size, max_depth, 0, &mut results)?; match output_format { OutputFormat::Json => { let json = serde_json::to_string_pretty(&results)?; println!("{}", json); } OutputFormat::Table => { println!("{:<50} {:<10} {:<20}", "Path", "Size", "Modified"); println!("{:-<80}", ""); for result in results { println!("{:<50} {:<10} {:<20}", result.path, result.size, result.modified); } } OutputFormat::Yaml => { let yaml = serde_yaml::to_string(&results)?; println!("{}", yaml); } } Ok(())
} #[derive(Serialize, Debug)]
struct FindResult { path: String, size: u64, modified: String, is_file: bool,
} fn find_files_recursive( dir: &Path, name_pattern: Option<&str>, extension: Option<&str>, min_size: Option<u64>, max_size: Option<u64>, max_depth: usize, current_depth: usize, results: &mut Vec<FindResult>,
) -> io::Result<()> { if current_depth > max_depth { return Ok(()); } for entry in fs::read_dir(dir)? { let entry = entry?; let path = entry.path(); let metadata = entry.metadata()?; let matches = check_file_criteria(&path, &metadata, name_pattern, extension, min_size, max_size); if matches { results.push(FindResult { path: path.display().to_string(), size: metadata.len(), modified: format!("{:?}", metadata.modified().unwrap_or(std::time::UNIX_EPOCH)), is_file: path.is_file(), }); } if path.is_dir() { find_files_recursive(&path, name_pattern, extension, min_size, max_size, max_depth, current_depth + 1, results)?; } } Ok(())
} fn check_file_criteria( path: &Path, metadata: &fs::Metadata, name_pattern: Option<&str>, extension: Option<&str>, min_size: Option<u64>, max_size: Option<u64>,
) -> bool { // Check name pattern if let Some(pattern) = name_pattern { if let Some(filename) = path.file_name() { let filename_str = filename.to_string_lossy(); if !filename_str.contains(pattern) { return false; } } } // Check extension if let Some(ext) = extension { if let Some(file_ext) = path.extension() { if file_ext != ext { return false; } } else { return false; } } // Check file size let file_size = metadata.len(); if let Some(min) = min_size { if file_size < min { return false; } } if let Some(max) = max_size { if file_size > max { return false; } } true
} fn convert_command( input: &PathBuf, output: Option<&PathBuf>, _from: Option<&Format>, to: &Format,
) -> Result<(), Box<dyn std::error::Error>> { let output_path = match output { Some(path) => path.clone(), None => { let mut path = input.clone(); let new_ext = match to { Format::Json => "json", Format::Toml => "toml", Format::Yaml => "yaml", Format::Csv => "csv", }; path.set_extension(new_ext); path } }; println!("Converting {} to {} (format: {:?})", input.display(), output_path.display(), to); // Implementation would depend on the specific formats // This is a simplified example let content = fs::read_to_string(input)?; match to { Format::Json => { // Convert to JSON format fs::write(&output_path, format!("{{\"content\": \"{}\"}}", content))?; } Format::Yaml => { // Convert to YAML format fs::write(&output_path, format!("content: |\n {}", content))?; } _ => { return Err("Conversion format not implemented".into()); } } println!("Conversion complete: {}", output_path.display()); Ok(())
}

