use crate::parser::Parser; pub struct Client { stream: TcpStream,
} impl Client { pub fn connect(addr: &str) -> std::io::Result<Self> { let stream = TcpStream::connect(addr)?; stream.set_read_timeout(Some(Duration::from_secs(5)))?; Ok(Client { stream }) } pub fn send_message(&mut self, message: Message) -> std::io::Result<()> { self.stream.write_all(&message.to_bytes())?; self.stream.flush() } pub fn receive_message(&mut self) -> std::io::Result<Message> { Parser::parse_message(&mut self.stream) } pub fn ping(&mut self) -> std::io::Result<bool> { self.send_message(Message::ping())?; let response = self.receive_message()?; Ok(response.msg_type == MessageType::Pong) } pub fn echo(&mut self, data: Vec<u8>) -> std::io::Result<Vec<u8>> { self.send_message(Message::echo(data.clone()).unwrap())?; let response = self.receive_message()?; if response.msg_type == MessageType::Echo { Ok(response.payload) } else { Err(std::io::Error::new( std::io::ErrorKind::InvalidData, "Expected Echo response", )) } }
}

