//! # Chat Protocol Library
//! //! A high-performance, type-safe implementation of a custom chat protocol
//! designed for real-time communication systems. pub mod message;
pub mod parser;
pub mod error;
pub mod codec; pub use message::{Message, MessageType, MessagePayload};
pub use parser::{ProtocolParser, ParseResult};
pub use error::{ProtocolError, ParseError};
pub use codec::{MessageCodec, FrameCodec}; /// Protocol version - increment for breaking changes
pub const PROTOCOL_VERSION: u8 = 1; /// Maximum message size to prevent DoS attacks
pub const MAX_MESSAGE_SIZE: usize = 1024 * 1024; // 1MB /// Default buffer size for parsing
pub const DEFAULT_BUFFER_SIZE: usize = 8192; #[cfg(test)]
mod tests { use super::*; #[test] fn test_protocol_constants() { assert_eq!(PROTOCOL_VERSION, 1); assert!(MAX_MESSAGE_SIZE > 0); }
} // protocol/src/message.rs
use serde::{Deserialize, Serialize};
use std::collections::HashMap; /// Represents a complete protocol message
#[derive(Debug, Clone, PartialEq, Serialize, Deserialize)]
pub struct Message { pub version: u8, pub message_type: MessageType, pub payload: MessagePayload,
} impl Message { pub fn new(message_type: MessageType, payload: MessagePayload) -> Self { Self { version: crate::PROTOCOL_VERSION, message_type, payload, } } /// Calculate the total message size including headers pub fn size(&self) -> usize { // Version (1) + Type (1) + Length (2) + Payload + Checksum (4) 8 + self.payload.serialized_size() } /// Validate message constraints pub fn validate(&self) -> Result<(), crate::ProtocolError> { if self.size() > crate::MAX_MESSAGE_SIZE { return Err(crate::ProtocolError::MessageTooLarge { size: self.size(), max_size: crate::MAX_MESSAGE_SIZE, }); } self.payload.validate()?; Ok(()) }
} /// All possible message payloads
#[derive(Debug, Clone, PartialEq, Serialize, Deserialize)]
#[serde(tag = "type")]
pub enum MessagePayload { Connect { username: String }, Disconnect, SendMessage { room: String, content: String }, JoinRoom { room: String }, LeaveRoom { room: String }, // Server responses ConnectAck { user_id: u32, server_info: String, }, MessageBroadcast { user_id: u32, username: String, room: String, content: String, timestamp: u64, }, UserJoined { user_id: u32, username: String, room: String, }, UserLeft { user_id: u32, username: String, room: String, }, Error { code: u16, message: String, },
} impl MessagePayload { /// Calculate serialized size for this payload pub fn serialized_size(&self) -> usize { // This is a simplified calculation match self { MessagePayload::Connect { username } => 1 + username.len(), MessagePayload::Disconnect => 1, MessagePayload::SendMessage { room, content } => { 1 + room.len() + content.len() } MessagePayload::JoinRoom { room } => 1 + room.len(), MessagePayload::LeaveRoom { room } => 1 + room.len(), MessagePayload::ConnectAck { user_id: _, server_info } => { 5 + server_info.len() } MessagePayload::MessageBroadcast { user_id: _, username, room, content, timestamp: _ } => { 13 + username.len() + room.len() + content.len() } MessagePayload::UserJoined { user_id: _, username, room } => { 5 + username.len() + room.len() } MessagePayload::UserLeft { user_id: _, username, room } => { 5 + username.len() + room.len() } MessagePayload::Error { code: _, message } => { 3 + message.len() } } } /// Validate payload constraints pub fn validate(&self) -> Result<(), crate::ProtocolError> { match self { MessagePayload::Connect { username } => { if username.is_empty() || username.len() > 32 { return Err(crate::ProtocolError::InvalidUsername); } } MessagePayload::SendMessage { room, content } => { if room.is_empty() || room.len() > 64 { return Err(crate::ProtocolError::InvalidRoomName); } if content.is_empty() || content.len() > 512 { return Err(crate::ProtocolError::InvalidMessageContent); } } MessagePayload::JoinRoom { room } | MessagePayload::LeaveRoom { room } => { if room.is_empty() || room.len() > 64 { return Err(crate::ProtocolError::InvalidRoomName); } } _ => {} // Server messages don't need client-side validation } Ok(()) }
} #[cfg(test)]
mod tests { use super::*; #[test] fn test_message_creation() { let payload = MessagePayload::Connect { username: "testuser".to_string(), }; let message = Message::new(MessageType::Connect, payload); assert_eq!(message.version, crate::PROTOCOL_VERSION); assert_eq!(message.message_type, MessageType::Connect); assert!(message.validate().is_ok()); } #[test] fn test_payload_validation() { // Valid payload let payload = MessagePayload::Connect { username: "validuser".to_string(), }; assert!(payload.validate().is_ok()); // Invalid payload - empty username let payload = MessagePayload::Connect { username: "".to_string(), }; assert!(payload.validate().is_err()); // Invalid payload - username too long let payload = MessagePayload::Connect { username: "a".repeat(50), }; assert!(payload.validate().is_err()); }
} // protocol/src/error.rs
use thiserror::Error; /// Errors that can occur during protocol operations
#[derive(Error, Debug)]
pub enum ProtocolError { #[error("Message too large: {size} bytes (max: {max_size})")] MessageTooLarge { size: usize, max_size: usize }, #[error("Invalid protocol version: {version} (expected: {expected})")] InvalidVersion { version: u8, expected: u8 }, #[error("Unknown message type: {message_type:#x}")] UnknownMessageType { message_type: u8 }, #[error("Invalid username")] InvalidUsername, #[error("Invalid room name")] InvalidRoomName, #[error("Invalid message content")] InvalidMessageContent, #[error("Parse error: {0}")] ParseError(#[from] ParseError), #[error("IO error: {0}")] IoError(#[from] std::io::Error), #[error("Serialization error: {0}")] SerializationError(String),
} /// Specific parsing errors
#[derive(Error, Debug)]
pub enum ParseError { #[error("Unexpected end of input")] UnexpectedEof, #[error("Invalid message length: {length}")] InvalidLength { length: u16 }, #[error("Checksum mismatch: expected {expected:#x}, got {actual:#x}")] ChecksumMismatch { expected: u32, actual: u32 }, #[error("Invalid UTF-8 string")] InvalidUtf8(#[from] std::string::FromUtf8Error), #[error("Buffer too small: need {needed} bytes, have {available}")] BufferTooSmall { needed: usize, available: usize },
} /// Type alias for results
pub type Result<T> = std::result::Result<T, ProtocolError>;
pub type ParseResult<T> = std::result::Result<T, ParseError>;

